<!DOCTYPE html>
<html {{--html--attr}}>
  <head>
    <meta http-equiv="Content-Type" content="text/html; charset=UTF-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <meta name="theme-color" content="#1f2734" />
    <meta
      name="viewport"
      content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no"
    />
    <meta http-equiv="x-dns-prefetch-control" content="on" />
    <link
      rel="dns-prefetch preconnect"
      href="{{--js-static-domain}}"
      crossorigin
    />
    <link
      rel="dns-prefetch preconnect"
      href="{{--css-static-domain}}"
      crossorigin
    />
    <link
      rel="dns-prefetch preconnect"
      href="{{--img-static-domain}}"
      crossorigin
    />
    <link
      rel="dns-prefetch preconnect"
      href="{{--font-static-domain}}"
      crossorigin
    />
    <style>
      .print .deskParent {
        display: none
      }

      .deskParent * {
        margin: 0;
        padding: 0;
        box-sizing: border-box
      }

      body {
        margin: 0
      }

      .dflex {
        display: -webkit-box;
        display: -ms-flexbox;
        display: flex;
      }

      .dflex {
        height: 100%;
        width: 100%
      }

      .flexgrow {
        -webkit-box-flex: 1;
        -ms-flex-positive: 1;
        flex-grow: 1;
        min-height: 0;
        min-width: 0;
      }

      .flexshrink {
        flex-shrink: 0;
        -moz-flex-shrink: 0;
        -webkit-flex-shrink: 0;
        -ms-flex-shrink: 0;
      }

      .flexbasis {
        flex-basis: 0%;
        -webkit-flex-basis: 0%;
        -moz-flex-basis: 0%;
        -ms-flex-basis: 0%;
      }

      .alignVertical {
        -webkit-box-align: center;
        -ms-flex-align: center;
        align-items: center;
      }

      .alignHorizontal {
        -webkit-box-pack: center;
        -ms-flex-pack: center;
        justify-content: center;
      }

      .flexrow {
        -webkit-box-orient: horizontal;
        -webkit-box-direction: normal;
        -webkit-flex-direction: row;
        -ms-flex-direction: row;
        flex-direction: row;
      }

      .flexcolumn {
        -webkit-box-orient: vertical;
        -webkit-box-direction: normal;
        -webkit-flex-direction: column;
        -ms-flex-direction: column;
        flex-direction: column;
      }

      .deskParent {
        height: 100vh;
        width: 100%
      }

      .header {
        background: #1f2734;
        height: 2.5rem
      }

      .stencil {

        background-color: #a2a2a2;
        animation: placeHolderShimmer 1s cubic-bezier(1, 0, 0, 1) infinite;
        -webkit-animation: placeHolderShimmer 1s cubic-bezier(1, 0, 0, 1) infinite -moz-animation: placeHolderShimmer 1s cubic-bezier(1, 0, 0, 1) infinite
      }

      @keyframes placeHolderShimmer {
        from {
          opacity: .4
        }

        50% {
          opacity: .6
        }

        to {
          opacity: 1
        }
      }

      .rectangular {
        height: 0.625rem;
        width: 6.875rem;
        display: inline-block;
        border-radius: 0.1875rem;
        margin-right: 0.9375rem;
      }

      .circle {
        height: 1.25rem;
        width: 1.25rem;
        display: inline-block;
        border-radius: 50%;
        margin: 0 0.9375rem;
      }

      .left {
        padding-left: 1.25rem
      }

      .loader {
        text-align: center;
        position: relative
      }

      .ball {
        padding-top: 130px;
        width: 1.25rem;
        float: left;
        position: relative;
      }

      .ball:after {
        content: '';
        position: absolute;
        bottom: 0;
        left: 0;
        width: 1.25rem;
        height: 1.25rem;
        float: left;
        border-radius: 50%;
      }

      .bar {
        clear: left;
        padding-top: 1.25rem;
        margin-left: -0.125rem;
        float: left;
      }

      .bar div {
        float: left;
        margin-left: 0.125rem;
        width: 1.125rem;
        height: 0.0625rem;
        border-radius: 50%;
        box-shadow: 0 0 3px rgba(204, 204, 204, 0.3);
        background: rgba(204, 204, 204, 0.3);
        filter: blur(0.125rem);
      }

      .ball:first-child:after,
      .bar>div:nth-child(1) {
        background: rgba(245, 94, 79, 1);
        background: -moz-linear-gradient(left, rgba(245, 94, 79, 1) 31%, rgba(120, 199, 127, 1) 100%);
        background: -webkit-gradient(left top, right top, color-stop(31%, rgba(245, 94, 79, 1)), color-stop(100%, rgba(120, 199, 127, 1)));
        background: -webkit-linear-gradient(left, rgba(245, 94, 79, 1) 31%, rgba(120, 199, 127, 1) 100%);
        background: -o-linear-gradient(left, rgba(245, 94, 79, 1) 31%, rgba(120, 199, 127, 1) 100%);
        background: -ms-linear-gradient(left, rgba(245, 94, 79, 1) 31%, rgba(120, 199, 127, 1) 100%);
        background: linear-gradient(to right, rgba(245, 94, 79, 1) 31%, rgba(120, 199, 127, 1) 100%);
        filter: progid:DXImageTransform.Microsoft.gradient(startColorstr='#1bb8c6', endColorstr='#00aade', GradientType=1);
      }

      .ball:nth-child(2):after,
      .bar>div:nth-child(2) {
        background: rgba(120, 199, 127, 1);
        background: -moz-linear-gradient(left, rgba(120, 199, 127, 1) 62%, rgba(0, 170, 222, 1) 100%);
        background: -webkit-gradient(left top, right top, color-stop(62%, rgba(120, 199, 127, 1)), color-stop(100%, rgba(0, 170, 222, 1)));
        background: -webkit-linear-gradient(left, rgba(120, 199, 127, 1) 62%, rgba(0, 170, 222, 1) 100%);
        background: -o-linear-gradient(left, rgba(120, 199, 127, 1) 62%, rgba(0, 170, 222, 1) 100%);
        background: -ms-linear-gradient(left, rgba(120, 199, 127, 1) 62%, rgba(0, 170, 222, 1) 100%);
        background: linear-gradient(to right, rgba(120, 199, 127, 1) 62%, rgba(0, 170, 222, 1) 100%);
        filter: progid:DXImageTransform.Microsoft.gradient(startColorstr='#1bb8c6', endColorstr='#00aade', GradientType=1);
      }

      .ball:nth-child(3):after,
      .bar>div:nth-child(3) {
        background: rgba(27, 184, 198, 1);
        background: -moz-linear-gradient(left, rgba(27, 184, 198, 1) 0, rgba(0, 170, 222, 1) 100%);
        background: -webkit-gradient(left top, right top, color-stop(0, rgba(27, 184, 198, 1)), color-stop(100%, rgba(0, 170, 222, 1)));
        background: -webkit-linear-gradient(left, rgba(27, 184, 198, 1) 0, rgba(0, 170, 222, 1) 100%);
        background: -o-linear-gradient(left, rgba(27, 184, 198, 1) 0, rgba(0, 170, 222, 1) 100%);
        background: -ms-linear-gradient(left, rgba(27, 184, 198, 1) 0, rgba(0, 170, 222, 1) 100%);
        background: linear-gradient(to right, rgba(27, 184, 198, 1) 0, rgba(0, 170, 222, 1) 100%);
        filter: progid:DXImageTransform.Microsoft.gradient(startColorstr='#1bb8c6', endColorstr='#00aade', GradientType=1);
      }

      .ball:nth-child(4):after,
      .bar>div:nth-child(4) {
        background: rgba(0, 170, 222, 1);
        background: -moz-linear-gradient(left, rgba(0, 170, 222, 1) 0, rgba(255, 226, 6, 1) 100%);
        background: -webkit-gradient(left top, right top, color-stop(0, rgba(0, 170, 222, 1)), color-stop(100%, rgba(255, 226, 6, 1)));
        background: -webkit-linear-gradient(left, rgba(0, 170, 222, 1) 0, rgba(255, 226, 6, 1) 100%);
        background: -o-linear-gradient(left, rgba(0, 170, 222, 1) 0, rgba(255, 226, 6, 1) 100%);
        background: -ms-linear-gradient(left, rgba(0, 170, 222, 1) 0, rgba(255, 226, 6, 1) 100%);
        background: linear-gradient(to right, rgba(0, 170, 222, 1) 0, rgba(255, 226, 6, 1) 100%);
        filter: progid:DXImageTransform.Microsoft.gradient(startColorstr='#00aade', endColorstr='#ffe206', GradientType=1);
      }

      .ball:nth-child(5):after,
      .bar>div:nth-child(5) {
        background: rgba(159, 235, 188, 1);
        background: -moz-linear-gradient(left, rgba(159, 235, 188, 1) 0, rgba(159, 235, 188, 1) 0, rgba(235, 213, 50, 1) 35%, rgba(255, 226, 6, 1) 100%);
        background: -webkit-gradient(left top, right top, color-stop(0, rgba(159, 235, 188, 1)), color-stop(0, rgba(159, 235, 188, 1)), color-stop(35%, rgba(235, 213, 50, 1)), color-stop(100%, rgba(255, 226, 6, 1)));
        background: -webkit-linear-gradient(left, rgba(159, 235, 188, 1) 0, rgba(159, 235, 188, 1) 0, rgba(235, 213, 50, 1) 35%, rgba(255, 226, 6, 1) 100%);
        background: -o-linear-gradient(left, rgba(159, 235, 188, 1) 0, rgba(159, 235, 188, 1) 0, rgba(235, 213, 50, 1) 35%, rgba(255, 226, 6, 1) 100%);
        background: -ms-linear-gradient(left, rgba(159, 235, 188, 1) 0, rgba(159, 235, 188, 1) 0, rgba(235, 213, 50, 1) 35%, rgba(255, 226, 6, 1) 100%);
        background: linear-gradient(to right, rgba(159, 235, 188, 1) 0, rgba(159, 235, 188, 1) 0, rgba(235, 213, 50, 1) 35%, rgba(255, 226, 6, 1) 100%);
        filter: progid:DXImageTransform.Microsoft.gradient(startColorstr='#9febbc', endColorstr='#ffe206', GradientType=1);
      }

      .firstball {
        animation: cradle_left .375s ease-in-out 0s infinite alternate;
      }

      .lastball {
        animation: cradle_right .375s ease-in-out 0s infinite alternate;
      }

      .first {
        animation: reflect_left .375s ease-in-out 0s infinite alternate;
      }

      .last {
        animation: reflect_right .375s ease-in-out 0s infinite alternate;
      }

      @keyframes cradle_left {
        0% {
          transform: rotate(0) translateY(0)
        }

        50% {
          transform: rotate(0) translateY(0)
        }

        100% {
          transform: rotate(50deg) translateY(-1.25rem)
        }
      }

      @keyframes cradle_right {
        0% {
          transform: rotate(-50deg) translateY(-1.25rem)
        }

        50% {
          transform: rotate(0) translateY(0)
        }

        100% {
          transform: rotate(0) translateY(0)
        }
      }

      @keyframes reflect_left {
        0% {
          transform: translateX(0)
        }

        50% {
          transform: translateX(0)
        }

        100% {
          transform: translateX(-1.5625rem)
        }
      }

      @keyframes reflect_right {
        0% {
          transform: translateX(1.5625rem)
        }

        50% {
          transform: translateY(0)
        }

        100% {
          transform: translateY(0)
        }
      }
    </style>
    {{--favicon}}
    <link
      href="//vimal-zt58.tsi.zohocorpin.com:9090//css/styles.css"
      rel="stylesheet"
    />

  <body>
    <div id="react">
      <div class="deskParent dflex flexcolumn">
        <div class="header flexshrink ">
          <div class="dflex cover flexrow">
            <div class="left flexgrow flexshrink flexbasis">
              <div class="dflex cover flexrow alignVertical">
                <span class="stencil rectangular"></span>
                <span class="stencil rectangular"></span>
                <span class="stencil rectangular"></span>
                <span class="stencil rectangular"></span>
                <span class="stencil rectangular"></span>
                <span class="stencil rectangular"></span>
              </div>
            </div>
            <div class="right">
              <div class="dflex cover flexrow alignVertical">
                <span class="stencil circle"></span>
                <span class="stencil circle"></span>
                <span class="stencil circle"></span>
                <span class="stencil circle"></span>
                <span class="stencil circle"></span>
              </div>
            </div>
          </div>
        </div>
        <div class="footer flexgrow flexshrink flexbasis">
          <div class="dflex cover flexrow alignVertical alignHorizontal">
            <div class="loader">
              <div class="ball firstball"></div>
              <div class="ball"></div>
              <div class="ball"></div>
              <div class="ball"></div>
              <div class="ball lastball"></div>
              <div class="bar">
                <div class="first"></div>
                <div></div>
                <div></div>
                <div></div>
                <div class="last"></div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>

      }
